// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import { useSelector, useDispatch } from 'react-redux';
import { logout } from './features/authSlice';

// Pages & Components
import Login from './pages/Login';
import Register from './pages/Register';
import FileUploader from './components/FileUploader';
import ChartVisualizer from './components/ChartVisualizer';
import History from './components/History';
import AdminDashboard from './components/AdminDashboard';

// ProtectedRoute component for route protection
function ProtectedRoute({ children, adminOnly = false }) {
  const auth = useSelector((state) => state.auth);
  if (!auth.token) {
    // Not logged in
    return <Navigate to="/login" replace />;
  }
  if (adminOnly && auth.user?.role !== 'admin') {
    // Not admin
    return <Navigate to="/" replace />;
  }
  return children;
}

// Layout component with navigation
function Layout({ children }) {
  const auth = useSelector((state) => state.auth);
  const dispatch = useDispatch();

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col">
      <nav className="bg-white shadow-md px-8 py-4 flex items-center space-x-6 sticky top-0 z-10">
        <Link to="/" className="font-semibold text-lg text-blue-700 hover:underline">
          Home
        </Link>

        {auth.token ? (
          <>
            <Link to="/upload" className="hover:text-blue-600">
              Upload
            </Link>
            <Link to="/history" className="hover:text-blue-600">
              History
            </Link>
            {auth.user?.role === 'admin' && (
              <Link to="/admin" className="hover:text-blue-600">
                Admin
              </Link>
            )}
            <button
              onClick={() => dispatch(logout())}
              className="ml-auto bg-red-500 text-white px-3 py-1 rounded hover:bg-red-600 transition"
            >
              Logout ({auth.user?.username})
            </button>
          </>
        ) : (
          <>
            <Link to="/login" className="ml-auto hover:text-blue-600">
              Login
            </Link>
            <Link to="/register" className="hover:text-blue-600">
              Register
            </Link>
          </>
        )}
      </nav>

      <main className="flex-grow p-6 max-w-7xl mx-auto">{children}</main>

      <footer className="bg-white shadow-inner p-4 text-center text-gray-500">
        &copy; {new Date().getFullYear()} Excel Analysis Platform
      </footer>
    </div>
  );
}

// Simple Home page
function Home() {
  return (
    <div className="max-w-3xl mx-auto text-center mt-20">
      <h1 className="text-4xl font-bold mb-4 text-gray-800">Welcome to Excel Analysis Platform</h1>
      <p className="text-lg text-gray-600">
        Upload Excel files, create interactive charts, and analyze your data effortlessly.
      </p>
    </div>
  );
}

export default function App() {
  return (
    <Router>
      <Layout>
        <Routes>
          <Route path="/" element={<Home />} />

          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />

          <Route
            path="/upload"
            element={
              <ProtectedRoute>
                <FileUploader />
              </ProtectedRoute>
            }
          />

          {/* 
            Note: For ChartVisualizer, you should pass data as props or manage through redux/context 
            depending on your app's state design.
            Here we place a placeholder route for visualization if you connect it later.
          */}
          <Route
            path="/visualize"
            element={
              <ProtectedRoute>
                {/* Replace `data` prop below with actual data */}
                <ChartVisualizer data={[]} />
              </ProtectedRoute>
            }
          />

          <Route
            path="/history"
            element={
              <ProtectedRoute>
                <History />
              </ProtectedRoute>
            }
          />

          <Route
            path="/admin"
            element={
              <ProtectedRoute adminOnly={true}>
                <AdminDashboard />
              </ProtectedRoute>
            }
          />

          {/* Fallback route for 404 */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </Layout>
    </Router>
  );
}
